    'help.WhatAreThingsThatPotentiallyFraudulentBuyersDo_content': '<ul><li>\u0627\u0632 \u0634\u0645\u0627 \u062F\u0631\u062E\u0648\u0627\u0633\u062A \u0645\u06CC \u06A9\u0646\u0646\u062F \u06A9\u0647 \u067E\u0648\u0644 \u0631\u0627 \u0628\u0647 \u062D\u0633\u0627\u0628 \u0622\u0646\u0647\u0627 \u0648\u0627\u0631\u06CC\u0632\u06A9\u0646\u06CC\u062F. </li><li>\u062E\u0631\u06CC\u062F\u0627\u0631\u06CC\u06A9 \u0686\u06A9 \u0628\u0627\u0646\u06A9\u06CC \u0628\u0627 \u0645\u0628\u0644\u063A \u0628\u0627\u0644\u0627 (\u0627\u0645\u0627 \u062C\u0639\u0644\u06CC) \u0628\u0627\u0628\u062A \u06A9\u0627\u0644\u0627\u06CC \u0645\u0648\u0631\u062F \u0641\u0631\u0648\u0634 \u0627\u0631\u0627\u0626\u0647 \u0645\u06CC \u06A9\u0646\u062F. \u0645\u0628\u0644\u063A \u0686\u06A9 \u0645\u0639\u0645\u0648\u0644\u0627 \u0628\u06CC\u0634\u062A\u0631\u0627\u0632\u0642\u06CC\u0645\u062A \u06A9\u0627\u0644\u0627\u06CC \u0634\u0645\u0627\u0633\u062A \u0648 \u062E\u0631\u06CC\u062F\u0627\u0631\u0627\u0632\u0634\u0645\u0627 \u062F\u0631\u062E\u0648\u0627\u0633\u062A \u0645\u06CC \u06A9\u0646\u062F \u06A9\u0647 \u0627\u062E\u062A\u0644\u0627\u0641 \u067E\u0648\u0644 \u0631\u0627 \u0627\u0632\u0637\u0631\u06CC\u0642 \u06CC\u06A9 \u0633\u0631\u0648\u06CC\u0633 \u0627\u0646\u062A\u0642\u0627\u0644 \u067E\u0648\u0644 \u0628\u0631\u0627\u06CC\u0634 \u0627\u0631\u0633\u0627\u0644 \u06A9\u0646\u06CC\u062F. \u0628\u0627\u0646\u06A9 \u0647\u0627 \u0645\u0639\u0645\u0648\u0644\u0627 \u0627\u06CC\u0646 \u0646\u0648\u0639 \u0686\u06A9 \u062C\u0639\u0644\u06CC \u0631\u0627 \u067E\u0631\u062F\u0627\u062E\u062A \u06A9\u0631\u062F\u0647 \u0648 \u0633\u067E\u0633 \u0648\u0642\u062A\u06CC \u06A9\u0647 \u0628\u0647 \u062F\u0644\u06CC\u0644 \u0646\u0628\u0648\u062F \u067E\u0648\u0644 \u062F\u0631 \u062D\u0633\u0627\u0628 \u0628\u0631\u06AF\u0634\u062A \u0645\u06CC \u062E\u0648\u0631\u062F\u060C \u0634\u0645\u0627 \u0631\u0627 \u0645\u0633\u0626\u0648\u0644 \u0645\u06CC \u062F\u0627\u0646\u0646\u062F. \u062F\u0631\u0627\u06CC\u0646 \u0646\u0648\u0639 \u06A9\u0644\u0627\u0647\u0628\u0631\u062F\u0627\u0631\u06CC \u0645\u0639\u0645\u0648\u0644\u0627 \u06CC\u06A9 \u0637\u0631\u0641 \u0633\u0648\u0645 \u0646\u06CC\u0632\u0639\u0645\u0644 \u0645\u06CC \u06A9\u0646\u062F (\u0639\u0627\u0645\u0644 \u0627\u0646\u062A\u0642\u0627\u0644 \u067E\u0648\u0644\u060C \u0634\u0631\u06CC\u06A9 \u06A9\u0627\u0631\u06CC \u06A9\u0647 \u0628\u0647 \u062E\u0631\u06CC\u062F\u0627\u0631 \u067E\u0648\u0644 \u0628\u062F\u0647\u06A9\u0627\u0631\u0627\u0633\u062A). \u0645\u0627 \u0628\u0647 \u0634\u062F\u062A \u0628\u0627 \u062D\u0648\u0627\u0644\u0647 \u06A9\u0631\u062F\u0646 \u067E\u0648\u0644 \u0645\u062E\u0627\u0644\u0641\u062A \u0645\u06CC \u06A9\u0646\u06CC\u0645 .</li><li> \u06CC\u06A9 \u0633\u0631\u0648\u06CC\u0634 \u0646\u0627\u0634\u0646\u0627\u0633 \u062D\u0648\u0627\u0644\u0647 \u06CC\u0627 \u067E\u0631\u062F\u0627\u062E\u062A \u067E\u0648\u0644 \u0631\u0627 \u0628\u0647 \u0634\u0645\u0627 \u062A\u0648\u0635\u06CC\u0647 \u0645\u06CC \u06A9\u0646\u0646\u062F.</li><li> \u0633\u0641\u0627\u0631\u0634\u0627\u062A \u0628\u0632\u0631\u06AF\u06CC \u0628\u0631\u0627\u06CC \u0627\u0631\u0633\u0627\u0644 \u0628\u0647 \u062E\u0627\u0631\u062C \u0627\u0632 \u06A9\u0634\u0648\u0631\u0645\u06CC \u062F\u0647\u0646\u062F.</li><li> \u0628\u0647 \u0622\u0646\u0647\u0627 \u0628\u06AF\u0648\u06CC\u06CC\u062F \u06A9\u0647 \u0646\u06CC\u0645\u06CC \u0627\u0632 \u067E\u0648\u0644 \u0631\u0627 \u0642\u0628\u0644 \u0627\u0632\u062F\u0631\u06CC\u0627\u0641\u062A \u06A9\u0627\u0644\u0627 \u0648 \u0646\u06CC\u0645 \u062F\u06CC\u06AF\u0631 \u0631\u0627 \u067E\u0633 \u0627\u0632\u062F\u0631\u06CC\u0627\u0641\u062A \u06A9\u0627\u0644\u0627 \u067E\u0631\u062F\u0627\u062E\u062A \u062E\u0648\u0627\u0647\u06CC\u062F \u06A9\u0631\u062F.</li><li> \u0628\u0647 \u0634\u0645\u0627 \u06CC\u06A9 \u0634\u0645\u0627\u0631\u0647 \u062A\u0644\u0641\u0646 \u0642\u0627\u0628\u0644 \u0634\u0646\u0627\u0633\u0627\u06CC\u06CC \u0646\u062E\u0648\u0627\u0647\u0646\u062F \u062F\u0627\u062F.</li><li> \u0628\u0627 \u06CC\u06A9 \u06A9\u0627\u0631\u062A \u0628\u06CC\u0646 \u0627\u0644\u0645\u0644\u0644\u06CC \u06CC\u0627 \u0686\u06A9 \u0628\u0627\u0646\u06A9\u06CC \u067E\u0631\u062F\u0627\u062E\u062A \u062E\u0648\u0627\u0647\u0646\u062F \u06A9\u0631\u062F.</li></ul>',
